ListComponent  -->\n\nChatBotModule->MessageListComponent \n\n\n\n\n\nMessageComponent \n\nMessageComponent \n\nMessageComponent  -->\n\nChatBotModule->MessageComponent \n\n\n\n\n\nSharedModule\n\nSharedModule\n\nChatBotModule -->\n\nSharedModule->ChatBotModule\n\n\n\n\n\nDirectLineService\n\nDirectLineService\n\nChatBotModule -->\n\nDirectLineService->ChatBotModule\n\n\n\n\n\nAgentTransferService\n\nAgentTransferService\n\nChatBotModule -->\n\nAgentTransferService->ChatBotModule\n\n\n\n\n\n\n          \n          \n          \n              Zoom in\n              Reset\n              Zoom out\n          \n      \n      \n      \n\n\n    \n        Info\n    \n\n\n    \n        Source\n    \n\n\n\n    \n\n        \n            File\n        \n        \n            ClientApps/Chatbot/src/chat-bot/chat-bot.module.ts\n        \n\n            \n                Description\n            \n            \n                This module contains all necessary components to render the chat window,\nservices to make API requests to retrieve tokens and chat with the bot\n\n            \n\n        \n            \n                \n                    Declarations\n                    \n                            \n                                ChatBotComponent\n                            \n                            \n                                ChatHeaderPanelComponent\n                            \n                            \n                                InputBarComponent\n                            \n                            \n                                MessageListComponent\n                            \n                            \n                                MessageComponent\n                            \n                    \n                \n                \n                    Providers\n                    \n                            \n                                     DirectLineService\n                            \n                       